import React from 'react'
import CartItems from '../../Components/Cart/CartItems'
import PriceDetails from '../../Components/Cart/PriceDetails/PriceDetails'
import './cart.css'
function Cart() {
    return (
        <div className="cart-container">
            <CartItems/>
            <PriceDetails/>
        </div>
    )
}

export default Cart
